/*Table structure for table `t_edoc_doc_file` */

DROP TABLE IF EXISTS `t_edoc_doc_file`;

CREATE TABLE `t_edoc_doc_file` (
  `PK_DOC_FILE` int(11) NOT NULL AUTO_INCREMENT,
  `FK_DOC` int(11) NOT NULL,
  `C_FILE_NAME` varchar(256) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `C_FILE_CONTENT` text CHARACTER SET utf8 COLLATE utf8_unicode_ci,
  PRIMARY KEY (`PK_DOC_FILE`)
) ENGINE=MyISAM AUTO_INCREMENT=53 DEFAULT CHARSET=latin1;

/*Data for the table `t_edoc_doc_file` */

/*Table structure for table `t_edoc_folder` */

DROP TABLE IF EXISTS `t_edoc_folder`;

CREATE TABLE `t_edoc_folder` (
  `PK_FOLDER` int(11) NOT NULL AUTO_INCREMENT,
  `FK_USER` int(11) NOT NULL,
  `C_CODE` varchar(200) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `C_NAME` varchar(1000) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `C_DESCRIPTION` varchar(4000) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `C_CREATE_DATE` datetime DEFAULT NULL,
  `C_IS_CLOSED` tinyint(4) DEFAULT NULL,
  `C_STATUS` tinyint(4) DEFAULT NULL,
  `C_XML_DATA` text CHARACTER SET utf8 COLLATE utf8_unicode_ci,
  PRIMARY KEY (`PK_FOLDER`),
  KEY `C_CODE` (`C_CODE`)
) ENGINE=MyISAM AUTO_INCREMENT=10 DEFAULT CHARSET=latin1;

/*Data for the table `t_edoc_folder` */

/*Table structure for table `t_edoc_folder_doc` */

DROP TABLE IF EXISTS `t_edoc_folder_doc`;

CREATE TABLE `t_edoc_folder_doc` (
  `FK_FOLDER` int(11) NOT NULL,
  `FK_DOC` int(11) NOT NULL,
  `FK_USER` int(11) DEFAULT NULL,
  `C_CREATE_DATE` datetime DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

/*Data for the table `t_edoc_folder_doc` */

/*Table structure for table `t_edoc_folder_user` */

DROP TABLE IF EXISTS `t_edoc_folder_user`;

CREATE TABLE `t_edoc_folder_user` (
  `FK_FOLDER` int(11) NOT NULL,
  `FK_USER` int(11) DEFAULT NULL,
  `C_USER_TYPE` varchar(4) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

/*Data for the table `t_edoc_folder_user` */

/*Table structure for table `t_edoc_message` */

DROP TABLE IF EXISTS `t_edoc_message`;

CREATE TABLE `t_edoc_message` (
  `PK_MESSAGE` int(11) NOT NULL AUTO_INCREMENT,
  `C_MESSAGE_TITLE` varchar(4000) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `C_FROM_USER_ID` int(11) NOT NULL,
  `C_FROM_USER_NAME` varchar(500) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `C_TO_USER_ID` int(11) DEFAULT NULL,
  `C_TO_USER_NAME` varchar(500) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `C_MESSAGE_CONTENT` varchar(4000) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `C_DATE_CREATED` datetime DEFAULT NULL,
  `C_IS_READ` tinyint(4) DEFAULT NULL,
  `FK_STEP_SEQ` int(11) DEFAULT NULL,
  `FK_DOC` int(11) DEFAULT NULL,
  PRIMARY KEY (`PK_MESSAGE`),
  KEY `C_TO_USER_ID` (`C_TO_USER_ID`),
  KEY `C_FROM_USER_ID` (`C_FROM_USER_ID`)
) ENGINE=MyISAM AUTO_INCREMENT=349 DEFAULT CHARSET=latin1;

/*Data for the table `t_edoc_message` */

/*Table structure for table `t_news_article` */

DROP TABLE IF EXISTS `t_news_article`;

CREATE TABLE `t_news_article` (
  `PK_ARTICLE` int(11) NOT NULL AUTO_INCREMENT,
  `C_TITLE` varchar(500) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `C_ATTACH_FILE_NAME` varchar(256) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `C_SHORT_CONTENT` text CHARACTER SET utf8 COLLATE utf8_unicode_ci,
  `C_CONTENT` text,
  `C_CREATE_BY` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `C_CREATE_DATE` datetime DEFAULT NULL,
  `C_UPDATE_BY` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `C_UPDATE_DATE` datetime DEFAULT NULL,
  `C_BEGIN_DATE` datetime DEFAULT NULL,
  `C_END_DATE` datetime DEFAULT NULL,
  `C_SLUG` varchar(500) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `C_XML_DATA` text,
  `C_LINK_TO_ATTACH` tinyint(4) DEFAULT NULL,
  `C_STATUS` tinyint(4) DEFAULT NULL,
  PRIMARY KEY (`PK_ARTICLE`)
) ENGINE=MyISAM AUTO_INCREMENT=16 DEFAULT CHARSET=latin1;

/*Data for the table `t_news_article` */

/*Table structure for table `t_news_article_attach_file` */

DROP TABLE IF EXISTS `t_news_article_attach_file`;

CREATE TABLE `t_news_article_attach_file` (
  `PK_FILE` int(11) NOT NULL AUTO_INCREMENT,
  `FK_ARTICLE` int(11) NOT NULL,
  `C_FILE_NAME` varchar(256) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`PK_FILE`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

/*Data for the table `t_news_article_attach_file` */

/*Table structure for table `t_ps_article` */

DROP TABLE IF EXISTS `t_ps_article`;

CREATE TABLE `t_ps_article` (
  `PK_ARTICLE` int(11) NOT NULL AUTO_INCREMENT,
  `FK_INIT_USER` int(11) DEFAULT NULL,
  `FK_MEDIA` int(11) DEFAULT NULL,
  `C_BEGIN_DATE` datetime DEFAULT NULL,
  `C_END_DATE` datetime DEFAULT NULL,
  `C_STATUS` tinyint(4) DEFAULT NULL,
  `C_TITLE` varchar(1000) COLLATE utf8_unicode_ci DEFAULT NULL,
  `C_SUB_TITLE` varchar(1000) COLLATE utf8_unicode_ci DEFAULT NULL,
  `C_SUMMARY` text COLLATE utf8_unicode_ci,
  `C_CONTENT` text COLLATE utf8_unicode_ci,
  `C_SLUG` varchar(1000) COLLATE utf8_unicode_ci DEFAULT NULL,
  `C_MESSAGE` varchar(1000) COLLATE utf8_unicode_ci DEFAULT NULL,
  `C_KEYWORDS` varchar(256) COLLATE utf8_unicode_ci DEFAULT NULL,
  `C_TAGS` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL,
  `C_VIEWS` int(11) DEFAULT NULL,
  `C_XML_VERSION` text COLLATE utf8_unicode_ci,
  `C_PEN_NAME` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `C_CACHED_RATING` float DEFAULT NULL,
  `C_CACHED_RATING_COUNT` int(11) DEFAULT NULL,
  `C_HAS_VIDEO` tinyint(4) DEFAULT NULL,
  `C_HAS_PHOTO` tinyint(4) DEFAULT NULL,
  `C_FILE_NAME` varchar(1000) COLLATE utf8_unicode_ci DEFAULT NULL,
  `C_DEFAULT_CATEGORY` int(11) DEFAULT NULL,
  `C_REDIRECT_URL` varchar(1000) COLLATE utf8_unicode_ci DEFAULT NULL,
  `C_DEFAULT_WEBSITE` int(11) DEFAULT NULL,
  `FK_EMPLOYEE` int(11) DEFAULT NULL,
  `C_IS_COPY` tinyint(4) DEFAULT NULL,
  `C_IS_IMG_NEWS` int(11) DEFAULT '0',
  PRIMARY KEY (`PK_ARTICLE`),
  KEY `C_STATUS` (`C_STATUS`),
  KEY `C_DEFAULT_WEBSITE` (`C_DEFAULT_WEBSITE`),
  KEY `C_BEGIN_DATE` (`C_BEGIN_DATE`),
  KEY `C_END_DATE` (`C_END_DATE`),
  FULLTEXT KEY `C_CONTENT` (`C_CONTENT`),
  FULLTEXT KEY `C_SUMMARY` (`C_SUMMARY`),
  FULLTEXT KEY `C_TAGS` (`C_TAGS`),
  FULLTEXT KEY `C_KEYWORDS` (`C_KEYWORDS`),
  FULLTEXT KEY `C_SUB_TITLE` (`C_SUB_TITLE`),
  FULLTEXT KEY `C_TITLE` (`C_TITLE`)
) ENGINE=MyISAM AUTO_INCREMENT=115331 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

